window.bookSummaryJSON = "<p>Cara Bishop already saved the world. Now, with the war over and the aliens defeated, she's teaching other pilots to fly the alien ships that turned the tide...until the government approaches her about joining a super-secret mission, that is.&nbsp;</p> <p>Steve Hunter is the product of alien DNA. He was created in a lab, designed to destroy the aliens in a ground war that was never fought. Now, they're finally putting him to use as the leader of this new mission.&nbsp;</p> <p>Together with the scientist who created Steve and the genius who invented the ship, Cara and her captain set off on a final adventure. The USS <i>Endeavor </i>goes in search of allies among the stars. What they find is more than they ever bargained for. If their mission is to be a success, they will have to solve a mystery and escape destruction at the hands of an all new foe. All in a day's work for the <i>Endeavor </i>crew.</p>"; 
